Storyline:

    Charming tale of mountaineer-trapper Murphy's first taste of &quot;big city&quot; life with young, sweet Sandra Dee in tow. She flees her family, which tried to trade her to Murphy for some of his beaver pelts, and then tags along with the reluctant Murphy. They get into all manner of trouble in town, and Murphy has to shoot the sheriff to rescue Dee from her job as a dance-hall girl.



